import { Component } from "react";
import './card.styles.css'

const Card = ({monster}) => {
const { name , id , email } = monster;

return (
    <div className="card-container"  >
        <img
            key = {id}                       
            alt = {`monster ${name}`} 
            src={`https://robohash.org/${id}?set=set2&size=180x180`}
        />
        <h2> { name } </h2>
        <p> {email} </p>
    </div>
) } 

export default Card;
